"<div>\n<i class=\"NoteType\">\nMedia Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong>Cadet Company Sergeant Major:</strong><br />\n<strong></strong><a href=\"media.html?mdx=43\">Badge</a>\n</p>\n<p>\nUK - <a href=\"https://www.cadetkitshop.com/pages/cadet-ranks\">Cadet kit shop.com</a>.....<br />\nCadet Company Sergeant Major<br />\nThis is the second highest rank you as a cadet can hope to achieve. This rank places you in charge of the cadets within their respective company\n</p>\n<p>\nUK - <a href=\"https://armycadets.com/news-and-events/features/quick-guide-to-cadet-badges-and-ranks/\">Army Cadets .com</a>....<br />\nRank: Cadet Company Sergeant Major<br />\nRequirements: Must have passed APC 4 star<br />\nResponsibilities: The senior cadet in a Company. Responsible for mentoring senior cadets and taking a Company parade.\n</p>\n<p>\n<a href=\"https://en.wikipedia.org/wiki/Company_sergeant_major\">Wiki</a>....<br />\nThe Company Sergeant Major (CSM) is the senior non-commissioned soldier of a company in the armies of many Commonwealth countries, responsible for administration, standards and discipline. In combat, his prime responsibility is the supply of ammunition to the company.\n</p>\n</div>\n</div>",
