"<div>\n<i class=\"NoteType\">\nMedia Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nRobinson-Quickenden Wedding 27 Sept 1899 _Haven_ Herne Bay\n</p>\n<p>\nFrom: Erick Scott: 2019 / 2020<br />\nTo: Laura Perry(nee Cheeseman)\n</p>\n<p>\nThe Haven of Laura's wedding to Robert Quickenden in September 1899. Dulcie was there too as a young bridesmaid with her sister Vera on the lawn. Also there were their parents Ernest Jones and Alice Gertrude Jones(nee Robinson, sister to the bride). My great-aunt Ena annotated the photo. Other photos suggest to me she may have mixed Minnie with May. As cousin Brian Brady says, she had been trying to recall after many decades.<br />\nI hope the attached listing written for cousin Maureen Brady(neeWest) by her mother, my great aunt Ena West(neeJohnson) will make it clear(but I notice on the Marriage Certificate that the Reverend was really Thomas Watkins not Watson).\n</p>\n<p>\nBy: Ena West(nee Johnson)<br />\nFor: Maureen Brady\n</p>\n<p>\nPicture of Wedding group (Quickendens &amp; her husband uncle Robert Quickenden) was taken on 27 Sept 1899 in the Haven garden (before Haven was altered with extra bedrooms added on at back)<br />\nPeople from left to right in group (grandpa William Johnson, your great grandpa Johnson) Uncle Ernest Jones &amp; Auntie Alice (Dulcie's mother and farther). The bearded gentleman in silk hat in back row was a mr. Pearce whose wife is next to the bride-groom his 4 daughters are the bride's maids on the left of bridegroom (Auntie Laura married a widower &amp; these people were his 1st wifes relatives).<br />\nClergyman Rev: Watkins married them (I can still remember him for he was a vicar at St John's Herne Bay for many years) the gentleman with side wiskers, head between bride-groom &amp; bride, was probabley bridegroom's father or uncle who was a former Quickenden. Next gentleman (with beard) &amp; lady was grandpa &amp; grandma Robert Robinson (Aunite Laura's Dulcie Alice Earnest my mother's, mothers father) the next gentleman, dark ..?.. the 3 brides-maids are Auntie Emm auntie May, aunite Minnie Uncle Charles (Sally's father Charles &amp; mother May) &amp; then my mother &amp; father your grandma &amp; grandpa George Johnson.<br />\nThe little brides maids are (sisters) vera &amp; auntie Dulcie Jones then to be wife to mr Henry (Harry) Cheeseman, Lauries mother. I still have auntie Laura's wedding dress &amp; veil, I tried to find it for your wedding ( have found it since, rather yellowed\n</p>\n<p>\nNB:<br />\nThank you Erick for this valuable information / contribution !!\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
