"<div>\n<i class=\"NoteType\">\nMedia Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWedding of Henry L Cheeseman and Dulcie S M Jones\n</p>\n<p>\nIt is a strong assumption of Laura Cheeseman (daughter to Henry and Dulcie) that the man standing to the left of Henry is his business partner John Hollingsworth and most likely his best man for the day. Sadly, Dulcie's farther had passed away and so Dulcie's cousin George Johnson (standing to Dulcie's right) gave Dulcie away.\n</p>\n<p>\nStanding from left - Thomas Cheeseman, probably John Hollingsworth (best man) Henry L Cheeseman (Bridegroom) and Dulcie S M Cheeseman nee Jone (Bridesmaid), George Johnson, Laura Quickenden nee Robinson, Sally Robison (bridesmaid). Seated from left - Rebecca Cheeseman nee Page, Nora Richards (bridesmaid), next bridesmaid ?, Emmeline Robinson on the end\n</p>\n</div>\n</div>",
